local Engine = {}
LoadModule = function(path,request)
        if not isfile(path) then
            local e = game:HttpGet(request)
            writefile(path,tostring(e))
            return loadstring(readfile(path))()
        else
            return loadstring(readfile(path))()
        end
end
Engine.AssertFolders = function(item)
    for i, v in pairs(item) do
      if not isfolder(v) then
        makefolder(v)
      end
    end
  end
Engine.AssertFiles = function(patch, item)
    for i, v in pairs(item) do
      if not isfile(patch .. v) then
        writefile(patch .. v, "")
      end
    end
end

