Engine.Secure = function(item)
    protect = function(item)
      local protect_gui = get_hidden_gui or gethui or syn and syn.protect_gui
      if protect_gui then
        pcall(protect_gui(item))
      else
        if game:GetService("CoreGui").RobloxGui then
          item.Parent = game:GetService("CoreGui").RobloxGui
        else
          item.Parent = game:GetService("CoreGui")
        end
        item.Archivable = false
      end
    end
    protect(item)
    item.Name = ""
    item.Archivable = false
    for i, v in pairs(item:GetDescendants()) do
      v.Name = " "
      v.Archivable = false
    end
  end
