Engine.Execute = function(str, args)
    if args.Name then
      NAME = args.Name
    else
        NAME = ""
    end
    local sucess, err = pcall(function()
        loadstring(str)() 
    end)
    
    if not sucess then
         game:GetService("StarterGui"):SetCore(
            "SendNotification",
            {
              Title = "[" .. NAME .. "]: SCRIPT ERROR",
              Text = err
            }
          )
    end
    
    --[[xpcall(
      function()
        loadstring(tostring(str))()
      end,
      function(err)
        if args.callback then
          print("callback")
          return args.callback(tostring(err))
        else
          game:GetService("StarterGui"):SetCore(
            "SendNotification",
            {
              Title = "[" .. NAME .. "]: SCRIPT ERROR",
              Text = err
            }
          )
        end
      end
    )]]
  end
Engine.AutoExecute = function()
    getgenv().HxAuto = true
    _G.HxAuto = true
    for i, v in pairs(listfiles("AutoExec")) do
      xpcall(
        function()
          loadstring(tostring(readfile(v)))()
        end,
        function(err)
          game:GetService("StarterGui"):SetCore(
            "SendNotification",
            {
              Title = "[" .. NAME .. "]: SCRIPT ERROR",
              Text = err
            }
          )
          warn("[" .. NAME .. "]: " .. err)
        end
      )
    end
  end

return Engine
